import React from 'react';
import Room from './Room';
import {Row} from "react-bootstrap";

function RoomList(){
    return(
        <div>
            <Row>
                <Room/>
            </Row>
            <Row>
                <Room/>
            </Row>
            <Row>
                <Room/>
            </Row>
        </div>
    );
}

export default RoomList
